import axios from "../axios";

const baseURL = "http://localhost:21309/api/";

export const GetAllUsers = () => {
  return axios
    .get(`${baseURL}/Users/GetAllUsers`)
    .then((res) => {
      console.log(res);
      return res.data;
    })
    .catch(function (error) {
      console.log("catch");
      return error;
    });
};
